#include<bits/stdc++.h>
#define E(x) ((x)*(x))
using namespace std;
int n,mikuX[1001],mikuY[1001],mikuW[1001];
double x,y,mikuLen=10000.0;
inline void move(double l){
	double sx=0,sy=0,g;
	for(int i=1;i<=n;i++){
		g=sqrt(E(mikuX[i]-x)+E(mikuY[i]-y));
		if(g==0)continue;
		sx+=mikuW[i]/g*(mikuX[i]-x);
		sy+=mikuW[i]/g*(mikuY[i]-y);
	}
	g=sqrt(sx*sx+sy*sy);
	x+=l/g*sx,y+=l/g*sy;
}
int main(){
	scanf("%d",&n);
	for(int i=1;i<=n;i++)scanf("%d%d%d",&mikuX[i],&mikuY[i],&mikuW[i]);
	while(mikuLen>4e-4)move(mikuLen),mikuLen*=0.618;
	cout<<fixed<<setprecision(3)<<x<<" "<<y;
}
